package entities;import javax.persistence.*;@Entity@Table(name = "almacenamientos")public class AlmacenamientoEntity {	@Id	@GeneratedValue(strategy = GenerationType.AUTO)	@Column(name = "id_almacenamiento", nullable = false)	private Integer idAlmacenamiento;	@Column(name = "calle")	private String calle;	@Column(name = "bloque")	private Integer bloque;	@Column(name = "estante")	private Integer estante;	@Column(name = "posicion")	private Integer posicion;	@Column(name = "libre")	private boolean libre;	@Column(name = "activo")	private boolean activo;	public AlmacenamientoEntity() {	}	public Integer getIdAlmacenamiento() {		return idAlmacenamiento;	}	public void setIdAlmacenamiento(Integer idAlmacenamiento) {		this.idAlmacenamiento = idAlmacenamiento;	}	public String getCalle() {		return calle;	}	public void setCalle(String calle) {		this.calle = calle;	}	public Integer getBloque() {		return bloque;	}	public void setBloque(Integer bloque) {		this.bloque = bloque;	}	public Integer getEstante() {		return estante;	}	public void setEstante(Integer estante) {		this.estante = estante;	}	public Integer getPosicion() {		return posicion;	}	public void setPosicion(Integer posicion) {		this.posicion = posicion;	}	public boolean isLibre() {		return libre;	}	public void setLibre(boolean libre) {		this.libre = libre;	}	public boolean isActivo() {		return activo;	}	public void setActivo(boolean activo) {		this.activo = activo;	}	}